          <div className="col-md-3" ><button value="0" onClick={e}>0</button></div>
          <div className="col-md-3" ><button value="CLR" onClick={e}>CLR</button></div>
          <div className="col-md-3" ><button value="=" onClick={e}>=</button></div>
